import React from 'react'
import Header from '../../components/Header/Header'
import Footer from '../../components/Footer/Footer'

export default function ErrorPage() {
  return (
    <div>
      <Header/>
      <body>
        <img src='ErrorPage/errorPage'/>
      </body>
     
      <Footer/>
    </div>
  );
}
